 function generatePlaceholderURL() {
  const baseUrl = "https://placehold.co/";

  // Use nullish coalescing operator for defaults
  const width = components?.width?.value ?? 600;
  const height = components?.height?.value ?? 400;
  const sizeParam = `${width}x${height}`;

  const bgColorParam = components?.bgColor?.selectedColorHex?.replace("#", "") ?? "CCCCCC";
  const textColorParam = components?.txtColor?.selectedColorHex?.replace("#", "") ?? "000000";

  const formatParam = components?.format?.value ?? 'png';

  const textParam = components?.custom?.value ?? "";

  // Construct the URL
  let imageUrl = `${baseUrl}${sizeParam}/${bgColorParam}/${textColorParam}.${formatParam}`;

  if (textParam) {
    imageUrl += `?text=${encodeURIComponent(textParam)}`;
  }

  return imageUrl;
}

